import React from 'react';

import{ Container } from "react-bootstrap";

const AUTH_URL = "https://accounts.spotify.com/authorize?" + 
"client_id=b2ef7909e45d474789ace09d4db0e931&response_type=code&redirect_uri=http://localhost:3000" + 
"&scope=streaming%20user-read-email%20user-read-private%20user-library-read%20user-library-modify%20" +
"user-read-playback-state%20user-modify-playback-state";
export default function Login() {
    return (
        <Container className='d-flex justify-content align-items-center'
         style={{minHeight}}>
            <a className="btn btn-success btn-lg"  href={AUTH_URL}>Login with Spotify</a>
        </Container>
    )
}
